var result = document.evaluate('//img[@class="ico"]',document, null, XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE, null);
    for (var i=0; i < result.snapshotLength; i++) {
                   for (var img in images) {
			if (images[result.snapshotItem(i).alt] == images[img]) {
				result.snapshotItem(i).src = images[img]; 
                                                                               }                    
                                            }
                                                  }

