var script = document.createElement('script'); 
script.type = "text/javascript"; 
script.innerHTML = (
	function mwfToggleBranch(postId) {
		var branch = document.getElementById('brn' + postId);
		var toggle = document.getElementById('tgl' + postId);
		if (!branch || !toggle) return;
		if (branch.style.display != 'none') {
			branch.style.display = 'none';
			toggle.src = 'data:image/png;base64,';
			toggle.title = 'Išskleisti šaką';
			toggle.alt = '+';
		}

		else {
			branch.style.display = '';
			toggle.src = 'data:image/png;base64,';
			toggle.title = 'Sutraukti šaką';
			toggle.alt = '-';
		}
	}

).toString();
document.getElementsByTagName('head')[0].appendChild(script);


var script2 = document.createElement('script'); 
script2.type = "text/javascript"; 
script2.innerHTML = (
	function mwfToggleCategState(categId) {
		var calledByScript = arguments[1];
		var categ = document.getElementById('cat' + categId);
		var toggle = document.getElementById('tgl' + categId);
		if (!categ || !toggle) return;
		if (categ.style.display != 'none') {
			categ.style.display = 'none';
			toggle.src = 'data:image/png;base64,';
			toggle.title = 'Išskleisti kategoriją';
			toggle.alt = '+';
		}
		else {
			categ.style.display = '';
			toggle.src = 'data:image/png;base64,';
			toggle.title = 'Suskleisti kategoriją';
			toggle.alt = '-';
		}
	}

).toString();
document.getElementsByTagName('head')[0].appendChild(script2);
